import styled from "styled-components";
import { useSelector } from "react-redux";
import { useHistory } from "react-router";
import { useEffect } from "react";

import { ComponentHeaderAuth } from "@components";
import { selectMerchant, setExternalLogin } from "@redux";
import { ModuleTel } from "@modules";
import { enumExternalMethod, PATH_SIGN_UP_EMAIL } from "@configs";

export const PageSignUpTelFrom = () => {
    //page hook
    const history = useHistory();
    //page variable
    const merchant = useSelector(selectMerchant);
    useEffect(() => {
        if (setExternalLogin !== enumExternalMethod.TEL) {
            history.push(PATH_SIGN_UP_EMAIL);
        }
    }, []);

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleTel />
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
